import React, { useEffect, useLayoutEffect, useRef, useState } from "react";
import styled from "styled-components";
import Profile from "./Profile";
import profile from "./../assets/img/profile.png";
import {
  motion,
  motionValue,
  useMotionValue,
  useTransform,
  useViewportScroll,
} from "framer-motion";
import { Component } from "react";
import Aos from "aos";
import "aos/dist/aos.css";
import { auto } from "@popperjs/core";
import postcssFlexbugsFixes from "postcss-flexbugs-fixes";

const Section = styled.section`
  justify-conter: center;
  align-item: center;
  display: flex;
`;
const Container1 = styled.div`
  padding: 5rem 2rem;
  display: flex;
  flex: 1;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
`;
const ColumnRight = styled.div`
  padding: 5rem 2rem;
  display: flex;
  flex:1
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
`;
const contentOffsetY = motionValue(0);

const Home = () => {
  const ref = useRef();
  const [progress, setProgress] = useState(0);
  const { scrollY, scrollYProgress } = useViewportScroll();
  useEffect(() => {
    Aos.init({ duration: 2000 });
    // var x = scrollYProgress.onChange((v) => v);
    // return x;
    return scrollYProgress.onChange((v) => setProgress(v));
  }, [scrollYProgress, scrollY]);

  const scale = useTransform(scrollYProgress, [1, 0], [0, 1], {
    clamp: false,
  });

  console.log(scrollY, scrollYProgress);
  return (
    <div>
      <motion.Section
        style={{
          scale,
        }}
        ref={ref}
        className="bg-dark   "
      >
        <motion.div className="top-50 start-100 p-5 vh-100 ">
          <Container1
            style={{ background: "#0000", height: "100%" }}
            data-aos="fade-left"
            clasName="bg-dark vh-100 "
          >
            <motion.div
              animate={{ scale: [5, 1] }}
              style={{
                height: "200px",
                width: "200px",
                borderRadius: "50%",
                background: "white",
                alignSelf: "center",
                justifyContent: "center",
              }}
            >
              <img
                src={profile}
                className="rounded-circle"
                style={{ height: "auto", width: "100%" }}
              ></img>
            </motion.div>
            <motion.div
              animate={{ scale: [5, 1] }}
              transition={{ duration: 0.9 }}
              style={{
                justifyContent: "center",
                alignSelf: "center",
              }}
            >
              <h2
                style={{ color: "#ffff", padding: 0, margin: 0 }}
                class="display-3  bottom-50 end-50"
              >
                Suman Karanjit
              </h2>
              <h4 class=" " style={{ color: "#6c757d" }}>
                Software Developer
              </h4>
            </motion.div>
          </Container1>
        </motion.div>
      </motion.Section>
      <div style={{ display: "flex", width: "100%" }}>
        <motion.div
          id="sidebar sticky"
          animate={{ scale: [5, 1] }}
          style={
            progress >= 0.38
              ? {
                  width: "250px",
                  position: "fixed",
                  top: "10%",
                  left: "8px",
                  height: "100vh",
                  zIndex: " 999",
                  color: "#fff",
                  margin: "0px",
                  transition: "all 0.3s",
                  justifyContent: "right",
                  marginRight: "10%",
                }
              : {
                  display: "none",
                }
          }
        >
          <motion.div
            animate={{ scale: [5, 1] }}
            style={{
              height: "80px",
              width: "80px",
              borderRadius: "50%",
            }}
          >
            <img
              src={profile}
              className="rounded-circle"
              style={{ height: "auto", width: "100%" }}
            ></img>
          </motion.div>
          <motion.div
            animate={{ scale: [0.2, 1] }}
            transition={{ duration: 2 }}
            style={{
              justifyContent: "center",
              alignSelf: "center",
            }}
          >
            <h2
              style={{ color: "#0000", padding: 0, margin: 0 }}
              class="display-3  bottom-50 end-50"
            >
              Suman Karanjit
            </h2>
            <h4 class=" " style={{ color: "#6c757d" }}>
              Software Developer
            </h4>
          </motion.div>
        </motion.div>
      </div>
      <motion.Section
        style={{ paddingLeft: "80px", marginLeft: "80px" }}
        className="bg-light "
      >
        <motion.div className=" container bg-light ">
          <motion.figure className="text-center">
            <h2
              data-aos="fade-right"
              style={{
                paddingBottom: "40px",
              }}
              class="display-4"
            >
              {scrollYProgress.get().toPrecision(2)}
              Education
            </h2>
            <div class="accordion accordion-flush" id="accordionFlushExample">
              <div class="accordion-item bg-light">
                <h2 class="accordion-header" id="flush-headingOne">
                  Bachelor's in Computer Science
                </h2>

                <div class="accordion-body">
                  MSUM, Moorhead, MN, USA (Graduated May 2021)
                </div>
              </div>
            </div>
            <div class="accordion accordion-flush" id="accordionFlushExample">
              <div class="accordion-item bg-light">
                <h2 class="accordion-header" id="flush-headingOne">
                  Diploma in Computer Information Technology
                </h2>

                <div class="accordion-body">
                  National Technology Institute, Auckland, New Zealand
                  (Graduated March 2012)
                </div>
              </div>
            </div>
          </motion.figure>
        </motion.div>
      </motion.Section>
      <motion.Section
        style={{ paddingLeft: "80px", marginLeft: "80px" }}
        className="bg-light "
      >
        <motion.div
          style={{ padding: "20px" }}
          className=" container-fluid bg-light "
        >
          <motion.figure className="text-center">
            <h2
              data-aos="fade-right"
              style={{ padding: "40px" }}
              class="display-4"
            >
              Experience
            </h2>
            <div class="accordion accordion-flush" id="accordionFlushExample">
